import React from "react";

const orders = {
  pending: [
    { id: 1, item: "Product A", quantity: 2 },
    { id: 2, item: "Product B", quantity: 1 },
  ],
  ready: [
    { id: 3, item: "Product C", quantity: 4 },
  ],
  completed: [
    { id: 4, item: "Product D", quantity: 2 },
  ],
};

const OrderSection = ({ title, orders }) => (
  <div className="bg-white shadow rounded-2xl p-4 w-full md:w-1/3">
    <h2 className="text-xl font-semibold mb-4">{title}</h2>
    <ul className="space-y-2">
      {orders.map((order) => (
        <li key={order.id} className="border p-3 rounded-xl shadow-sm">
          <p className="font-medium">{order.item}</p>
          <p className="text-sm text-gray-500">Quantity: {order.quantity}</p>
        </li>
      ))}
    </ul>
  </div>
);

const OrderPage = () => {
  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-6">Order Management</h1>
      <div className="flex flex-col md:flex-row gap-6">
        <OrderSection title="ðŸ•’ Pending Orders" orders={orders.pending} />
        <OrderSection title="âœ… Ready to Order" orders={orders.ready} />
        <OrderSection title="ðŸ“¦ Completed Orders" orders={orders.completed} />
      </div>
    </div>
  );
};

export default OrderPage;
